import axios from 'axios';

const fetchData = async () => {
  //return http.get("/people");
  try {
    const response = await axios.get("/people");
    console.log(JSON.stringify(response))
    return response.data;
  } catch (error) {
    throw new Error("Failed to fetch card data");
  }
};

const api = {
  fetchData,
};

export default api;
